//function to fetch data

export async function getAllPokemon(url){
    return new Promise((resolve,reject) =>{
        fetch(url)
            .then(res => res.json())
            .then(data =>{
                resolve(data);
            })
    })
}

export async function getPokemon(url){
    return new Promise((resolve, reject) => {
        //iterating all the url
        fetch(url)
    })
}
